import React from "react";
import "./styles_page.css"
import Nav_bar from "../components/Navbar";
import Footer from "../components/Footer";

function MainPage(){
    return(
        <>
            <div className="App">
                <Nav_bar />
            </div>
            <Footer />
        </> 
    );
}

export default MainPage;
